css:
[data-panda-theme=dark] {
    --colors-black: #1A141F;
    --colors-gray-100: #F5F3F7;
    --colors-gray-200: #E5E0EB;
    --colors-gray-300: #D9D1E0;
    --colors-gray-400: #D4D2D5;
    --colors-gray-500: #ABA7AF;
    --colors-gray-600: #4B3A5A;
    --colors-blue-100: #1A15D3;
    --colors-blue-200: #0F0BAB;
    --colors-blue-300: #0F0C9E;
    --colors-purple-100: #AE60EB;
    --colors-purple-200: #9D3FE7;
    --colors-purple-300: #6A17AB;
    --colors-purple-400: #602093;
    --colors-red-100: #E8A1B6;
    --colors-red-200: #D51A52;
    --colors-orange-100: #FF9500;
    --colors-green-100: #00B998;
    --colors-yellow-100: #FFE600;
    --colors-white: #FFFFFF;
    --gradients-purple: linear-gradient(159.13deg, theme(colors.purple.100) -24.13%, theme(colors.purple.200) 132.21%);
    --colors-link: var(--colors-blue-200);
    --colors-information-error: var(--colors-red-200);
    --colors-information-success: var(--colors-green-100);
    --colors-information-warning: var(--colors-orange-100);
    --colors-grayscale-bg-light-grey: var(--colors-gray-100);
    --colors-grayscale-spacer-light: var(--colors-gray-200);
    --colors-grayscale-spacer: var(--colors-gray-300);
    --colors-grayscale-disabled: var(--colors-gray-400);
    --colors-grayscale-border: var(--colors-gray-500);
    --colors-grayscale-hint-text: var(--colors-gray-600)
}
